import React , {Component} from "react"
import {getProfile} from "../FakeData/Users"

class Me extends Component{
    state = {
        isloading: false
    }
    

   // componentWillUpdate
async componentDidMount(){
    try{
        const user = await getProfile()
        this.setState({user:user.data}) 
        this.setState({isloading: true}) 

    }catch(error){

    }
}
    render(){
        if(this.state.isloading === false)return <p>Loading...></p>;
        const {user} = this.state
        console.log(user)
        return(
            <React.Fragment>
                <div className="jumbotron">
                    <div className="container">
                    <h1 className="display-3">Hello, {user.Name}!</h1>
                    <p>Welcome to The Online Product World, where you will find everything you need related by laptops and mobiles hardwares.</p>
                    </div>
                </div>
                <div className="container">
                <div className="row">
                {user.CreatedItems.map(item=>
                    <div className="col-md-4">
                    <h2>{item.Name}</h2>
                    <p>Donec id elit non mi porta gravida at eget metus. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus. Etiam porta sem malesuada magna mollis euismod. Donec sed odio dui. </p>
                    <p><a className="btn btn-secondary" href="#" role="button">View details »</a></p>
                     </div>
                    )}
                
                <div className="col-md-4">
                    <h2>Heading</h2>
                    <p>Donec id elit non mi porta gravida at eget metus. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus. Etiam porta sem malesuada magna mollis euismod. Donec sed odio dui. </p>
                    <p><a className="btn btn-secondary" href="#" role="button">View details »</a></p>
                </div>
                <div className="col-md-4">
                    <h2>Heading</h2>
                    <p>Donec sed odio dui. Cras justo odio, dapibus ac facilisis in, egestas eget quam. Vestibulum id ligula porta felis euismod semper. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus.</p>
                    <p><a className="btn btn-secondary" href="#" role="button">View details »</a></p>
                </div>
                </div>

  </div>
            </React.Fragment>
        )
    }
}

export default Me;
